import React from "react";
import GridList from "@material-ui/core/GridList";
import GridListTileBar from '@material-ui/core/GridListTileBar';
import GridListTile from "@material-ui/core/GridListTile";
import ListSubheader from '@material-ui/core/ListSubheader';
import IconButton from '@material-ui/core/IconButton';
import project1 from "../../assets/images/LiveMerch.png"

const Project = (props) => {

    return <GridList cellHeight={180} className="project-container">
        <GridListTile cols={2}>
            <ListSubheader id="projectHeader" component="div"><h1>Projects</h1></ListSubheader>
        </GridListTile>
        <GridListTile>
            <img src = {project1} alt="project-pic"></img>
            <GridListTileBar
              title={"LiveMerch"}
              actionIcon={
                    <IconButton >
                        Github
                    </IconButton>
              }
            />
        </GridListTile>
        <GridListTile>
            <img src = {project1} alt="project-pic"></img>
        </GridListTile>
        <GridListTile>
            <img src = "https://via.placeholder.com/100" alt="project-pic"></img>
        </GridListTile>
        <GridListTile>
            <img src = "https://via.placeholder.com/100" alt="project-pic"></img>
        </GridListTile>
    </GridList>
}

export default Project
